import React, { Component } from 'react';
import '../css/Movies.css'
import Back from './Back';

class ErrorPage extends Component {
  constructor (props){
  super(props);
  this.state = {
    pictures: '',
    filtered: [],
      movies: []
  };
    this.handleNext = this.handleNext.bind(this);
}

handleNext(id) {
   this.props.history.push(`movie/${id}`);
 }

  render() {
    return(
      <div>
        <div className="MainHeading">
          <Back history={this.props.history} />
          <div className="Stripe_one"></div>
          <div className="Stripe_two"></div>
          <div className="Stripe_three"></div>
          <div className="Stripe_four"></div>
          <div className="Stripe_five"></div>
          <div className="Stripe_six"></div>
          <img className="Logo" src="https://www.themoviedb.org/assets/2/v4/logos/primary-green-d70eebe18a5eb5b166d5c1ef0796715b8d1a2cbc698f96d311d62f894ae87085.svg" alt="" />
        </div>
        <div className="IndexList">
          <div className="MediaCollection">
          <div className="ErrorPage">
            <h2>This Movie is missing some information and can't be shown now</h2>
          </div>
          </div>
        </div>
    </div>

    )
  }
}

export default ErrorPage;
